import React from 'react';

export default function Home({ setActivePage }) {
  const services = [
    { key: 'implants', icon: 'ü¶∑', title: 'Dental Implants', desc: 'Advanced implant solutions' },
    { key: 'cleaning', icon: '‚ú®', title: 'Dental Cleaning', desc: 'Professional cleaning & care' },
    { key: 'cosmetic', icon: 'üòä', title: 'Cosmetic Dentistry', desc: 'Enhance your smile' },
    { key: 'emergency', icon: 'üö®', title: 'Emergency Care', desc: 'Immediate dental care' },
    { key: 'pediatric', icon: 'üë∂', title: 'Pediatric Dentistry', desc: 'Gentle care for kids' },
    { key: 'orthodontics', icon: 'üìè', title: 'Orthodontics', desc: 'Straighten your teeth' }
  ];

  return (
    <div>
      <div className="hero">
        <h1>Welcome to Desai Dental Clinic</h1>
        <p>Expert care with Dr. Rakesh Desai, Implant Specialist, Indy, Bijapur, Karnataka</p>
        <button className="cta-button" onClick={() => setActivePage('appointment')}>Book Your Appointment</button>
      </div>

      <div className="services-grid">
        {services.map((s) => (
          <div key={s.key} className="service-card" onClick={() => setActivePage('appointment')}>
            <span className="service-icon">{s.icon}</span>
            <h3>{s.title}</h3>
            <p>{s.desc}</p>
            <button className="show-details">Show Details</button>
          </div>
        ))}
      </div>
    </div>
  );
}
